import { AUTH } from '../constants/actionTypes';

import * as api from '../api/index.js';

export const signup = () => async (dispatch) => {
  try {
    //login
    history.pushState("/")
  } catch (error) {
    console.log(error.message);
  }
};

export const signin = () => async (dispatch) => {
    try {
      const { data } = await api.fetchPosts();
      history.pushState("/")
    } catch (error) {
      console.log(error.message);
    }
  };
